import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import LoginPage from './LoginPage';

function App() {
  return (
    <BrowserRouter>
      <div>
        <Route path="/" component={LoginPage} />
      </div>
    </BrowserRouter>
  );
}

export default App;
